def Problem(c0, c1, c2):
    #calculate the total number of pages in the book
    total_pages = 0
    for i in range(c0):
        if i == 0:
            total_pages += c1
        else:
            total_pages += c2

    #calculate the difference in pages between the first and second chapter
    diff = c1 - c2

    return diff

def egg_groups(c0, c1, c2):
    #calculate the maximum number of groups that can be created based on the number of eggs and the desired group size
    max_groups = c2 // c0

    #check if there are enough marbles to create the maximum number of groups
    if max_groups <= c1:
        return max_groups
    else:
        #if there are not enough marbles, calculate the maximum number of groups that can be created with the available marbles
        available_groups = c1
        return available_groups

def Problem(c0, c1, c2, c3):
    #Danny originally had c0 bottle caps and c1 wrappers
    bottle_caps_before = c0
    wrappers_before = c1

    #Now Danny has c2 bottle caps and c3 wrappers
    bottle_caps_after = c2
    wrappers_after = c3

    #Danny has more wrappers than bottle caps if the number of wrappers after collecting minus the number of wrappers before collecting is greater than the number of bottle caps after collecting minus the number of bottle caps before collecting
    if (wrappers_after - wrappers_before) > (bottle_caps_after - bottle_caps_before):
        return (wrappers_after - wrappers_before) - (bottle_caps_after - bottle_caps_before)
    else:
        return 0
